host_about:
I am a Doctoral Fellow at the St. John's University,  living in Queens, New York.

Love travelling. Visited over 15 other states in USA: Florida, Georgia, South Carolina, North Carolina, Virginia, Delaware, Maryland, Pennsylvania, New Jersey, Minnesota, Tennessee, Nevada, California, Connecticut,  Rhode Island and Massachusetts;

Stayed in London, UK and visited Worcester; 

Stayed in Brussels, Belgium and visited Ghent and Sea Bruge; AND Maastricht and Amsterdam, Netherlands; AND Paris and Versailles, France;

Stayed in Paderborn, Germany and visited Berlin, Hanover and Dusseldorf; 

Stayed in Okinawa, Japan and visited Tokyo, Nagoya, Kyoto and Osaka; 

Lived in Nairobi, Kenya and visited Mombasa, Machakos, Narok, Kisii, Kisumu, Kakamega, Eldoret, Lokichar, Nakuru, Thika, Nyeri, Embu and Meru;

Visited Mt. Kilimanjaro, Arusha and Da Es Salaam, Tanzania; AND Entebbe and Kampala, Uganda; AND Kigali and Nyagatare, Rwanda.

I love movies, novels, any good song and I play a mean game of chess.

I'm easy to get along with, and I deeply respect everyone I meet for I always learn something new.

Journalist, United Nations Correspondent  ;
Adjunct Prof. Media Studies, History and Italian language 
Married, two kids

